import React from 'react'

const Logout = () => {
    const handleLogout = () => {
        localStorage.removeItem("user");
        window.location.href = "/login"; // Redirect to login
    };
    
  return (
    
    <>
        <button onClick={handleLogout} className="btn btn-danger">Logout</button>

    </>
  )
}

export default Logout
